import Banner from './Conponentes/Banner';
import Formulario from './Conponentes/Formulario';
import Time from  './Conponentes/Time';
import { useState } from 'react';

function App() {

  const times = [
    {
      nome: 'Família Charlotte',
      corPrimaria: '#57C278',
      corSegundaria: '#D9F7E9'
    },
    {
      nome: 'Piratas do Barba Negra',
      corPrimaria: '#82CFFA',
      corSegundaria: '#E8F8FF'
    },
    {
      nome: 'Piratas das Feras',
      corPrimaria: '#A6D157',
      corSegundaria: '#F0F8E2'
    },
    {
      nome: 'Piratas Donquixote',
      corPrimaria: '#DB6EBF',
      corSegundaria: '#FAE9F5'
    },
    {
      nome: 'Marinha',
      corPrimaria: '#E06B69',
      corSegundaria: '#FDE7E8'
    },
    {
      nome: 'Piratas da Big Mom',
      corPrimaria: '#FFBA05',
      corSegundaria: '#FFF5D9'
    },
    {
      nome: 'Cipher Pol Number 9',
      corPrimaria: '#FF8A29',
      corSegundaria: '#FFEEDF'
    },
  ]

  const [Otakus, setOtakus] = useState([])

  const NovoOtakuInserido = (Otaku) => {
    console.log(Otaku)
    setOtakus([...Otakus, Otaku])
  }

  return (
    <div className="App">
      <Banner />
      <Formulario times={times.map()} OtakuInserido={Otaku => NovoOtakuInserido(Otaku)}/>
      {times.map(time => <Time key={time.nome} nome={time.nome} corPrimaria={time.corPrimaria} corSegundaria={time.corSegundaria} />)}
    </div>
  )
}

export default App;
